import React from 'react'

const Card = ({ pokemon }) => {
	console.log(pokemon);
	return (
		<div className='card'>
			<div className='img'>
				{ pokemon.name }
				<img src={pokemon.sprites['front_default']}/>
			</div>
		</div>
	)
}

export default Card;
